import React, { useEffect, useRef, useState } from "react";
import "../src/css/ff.css";
import axios from "axios";
import "../src/css/pay.css";
import { useNavigate } from "react-router-dom";
function FF() {
  const [jstate, setjstate] = useState();
  const [pamount, setpamount] = useState();
  const [gtype, setgtype] = useState();
  const [jsbn1, setjsbn1] = useState(false);
  const [jsbn2, setjsbn2] = useState(false);
  const [jsdbn, setjsdbn] = useState(false);
  const [pstatus, setpstatus] = useState();
  const gname = useRef(null);
  const [fsc1, setfsc1] = useState();
  const [fsc2, setfsc2] = useState();
  const [fsdc, setfsdc] = useState();
  const [joined, setjoined] = useState();
  const navigate = useNavigate();
  useEffect(() => {
    const fjstatus = async () => {
      const un = sessionStorage.getItem("un");
      await axios
        .post("http://localhost:4000/fjstatus", {
          username: un,
        })
        .then((res) => {
          if (res.data.count[0] < 50) {
            setfsc1(res.data.count[0]);
          } else {
            setfsc1(res.data.count[0]);
            setjoined("MATCH FULL");
          }
          if (res.data.count[1] < 50) {
            setfsc2(res.data.count[1]);
          } else {
            setfsc2(res.data.count[1]);
            setjoined("MATCH FULL");
          }
          if (res.data.count[2] < 50) {
            setfsdc(res.data.count[2]);
          } else {
            setfsdc(res.data.count[2]);
            setjoined("MATCH FULL");
          }
          if (res.data.fsolo1 === "av") {
            setjsbn1(true);
            setjoined("JOINED");
          }
          if (res.data.fsolo2 === "av") {
            setjsbn2(true);
            setjoined("JOINED");
          }
          if (res.data.fsquad === "av") {
            setjsdbn(true);
            setjoined("JOINED");
          }
        });
    };
    fjstatus();
  }, []);
  const pc = () => {
    setjstate(false);
  };
  const pay = async () => {
    if (gtype === "fsolo1") {
      const un = sessionStorage.getItem("un");
      await axios
        .post("http://localhost:4000/fsolo1", {
          username: un,
          gamename: gname.current.value,
        })
        .then((res) => {
          if (res.data.ws === "success") {
            window.location.reload(false);
            navigate("/ff");
          } else {
            setpstatus("LOW FUND RECHARGE YOUR WALLET");
          }
        });
    }
    if (gtype === "fsolo2") {
      const un = sessionStorage.getItem("un");
      await axios
        .post("http://localhost:4000/fsolo2", {
          username: un,
          gamename: gname.current.value,
        })
        .then((res) => {
          if (res.data.ws === "success") {
            window.location.reload(false);
            navigate("/ff");
          } else {
            setpstatus("LOW FUND RECHARGE YOUR WALLET");
          }
        });
    }
    if (gtype === "fsquad") {
      const un = sessionStorage.getItem("un");
      await axios
        .post("http://localhost:4000/fsquad", {
          username: un,
          gamename: gname.current.value,
        })
        .then((res) => {
          if (res.data.ws === "success") {
            window.location.reload(false);
            navigate("/ff");
          } else {
            setpstatus("LOW FUND RECHARGE YOUR WALLET");
          }
        });
    }
  };
  const fsolo1 = async () => {
    setpamount("20");
    setjstate(true);
    setgtype("fsolo1");
  };
  const fsolo2 = async () => {
    setpamount("20");
    setjstate(true);
    setgtype("fsolo2");
  };
  const fsquad = async () => {
    setpamount("20");
    setjstate(true);
    setgtype("fsquad");
  };
  const fs1 = {
    type: "SOLO",
    map: "BERMUDA",
    date: "01/01/2004",
    time: "10:00 am",
  };
  const fs2 = {
    type: "SOLO",
    map: "BERMUDA",
    date: "01/01/2004",
    time: "11:00 am",
  };
  const fsd = {
    type: "SQUAD",
    map: "BERMUDA",
    date: "01/01/2004",
    time: "12:00 am",
  };
  return jstate ? (
    <div id="pmain">
      <div id="jp">
        <div id="tc">
          <h2 id="phead">TERMS AND CONDITIONS</h2>
          <button id="pc" onClick={pc}>
            X
          </button>
        </div>
        <div id="jb">
          <input id="ptext" type="text" placeholder="GAME NAME" ref={gname} />
          <button id="pay" onClick={pay}>
            PAY={pamount}
          </button>
          <div id="pstatus">{pstatus}</div>
        </div>
      </div>
    </div>
  ) : (
    <div className="fmain">
      <div className="fdiv" id="fsolo">
        <div className="fimage"></div>
        <div className="fdown1">
          <h4>
            TYPE : <span>{fs1.type}</span>
          </h4>
          <h4>
            MAP : <span>{fs1.map}</span>
          </h4>
          <h4>
            DATE : <span>{fs1.date}</span>
          </h4>
          <h4>
            TIME : <span>{fs1.time}</span>
          </h4>
        </div>
        <div className="fdown2">
          <div id="fp">
            <div id="ifp" style={{ width: `${fsc1 * 2}%` }}></div>
          </div>
          <h4 id="fpn">{fsc1}/50</h4>
          {jsbn1 === false ? (
            <button className="bjoin" onClick={fsolo1}>
              JOIN
            </button>
          ) : (
            <div className="bjoined">{joined}</div>
          )}
        </div>
      </div>
      <div className="fdiv" id="fduo">
        <div className="fimage"></div>
        <div className="fdown1">
          <h4>
